import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <table style={{ width: "50%" }}>
        <tr>
          <td>Form Id</td>
          <td>Form Name</td>
          <td># Submissions</td>
          <td>Submit Page</td>
          <td>Submissions Page</td>
        </tr>
      </table>
    </div>
  );
}

export default App;
